import styled from 'styled-components';
import menu from '../../Assets/menu.png';
import search from '../../Assets/search.png';


const icones = [search, menu]

function IconesNavBar() {
    return (
        <Icones>
            {icones.map((icone) => (
                <Icone><img src={icone} alt='icone'></img></Icone>
            ))}
        </Icones>
    )
}


